    const post = props.post

    return(
        <Grid container direction = "column">
            <Grid item><p style = {{fontSize: "21px", fontWeight: "bold"}}>{post.title}</p></Grid>
            <Grid item><p>{post.description}</p></Grid>
        </Grid>
    )
}
